import React, { useState, useEffect } from 'react';
// import Todos from './components/Todos';

function App() {
  const [todos, setTodos] = useState();
  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/todos')
      .then((res) => res.json())
      .then((data) => setTodos(data));
  }, []);

  console.log(todos);

  return (
    <div>
      <h1>Hello</h1>
      <button></button>
    </div>
  );
}

export default App;

